import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import {Image, Col, Row, Navbar, Container, Nav, NavDropdown, Dropdown, DropdownButton} from 'react-bootstrap';
import logotipo from '../../assets/logo-better-price.png';
import './styles.css' 

const Layout = (props) =>{
  return(
    <>
      <nav className="decorate-nav">
        <img src={logotipo} alt='Logotipo de Better Price' Style="width:5.4em; height: 60px"/>
        <div className="content-nav">
          <div className="micuenta-container">
            <label for='micuenta'> Mi Cuenta </label>
            <select name='micuenta' id='micuenta'>
              <option value="volvo">Volvo</option>
              <option value="saab">Saab</option>
            </select>
          </div>
        </div>
      </nav>
      <footer> 
        {props.children}
      </footer>
    </>
  );
}

export default Layout;
